import React from "react";
import { Link } from "react-router-dom";


function List(props) { 
    const listLinks = props.links.map((link, index)  => <li key={index}><Link to={`./${link}`}>{link}</Link></li>); 
   //  return (<ul className={props.styleNew} >
   //    {listLinks}
   // </ul>)

   return(
      <ul>
         <li><Link to='/'></Link></li>
         <li><Link to='/sobre'>Sobre</Link></li>
      </ul>
   )
}

export default List;
